import React, { useEffect, useState } from 'react';
import { Read } from '../../APIServices/CRUDServices';

const ListTable = () => {
    let [DataList,SetDataList]= useState([]);

    useEffect(()=>{
        Read().then((Result)=>{
            SetDataList(Result)
        })
    })

    return (
        <div>
            <table className='table'>
                <thead>
                    <tr>
                        <th>Product Name</th>
                        <th>Product Code</th>
                        <th>Image</th>
                        <th>Unit Price</th>
                        <th>Qty</th>
                        <th>Total Price</th>
                        <th>Action</th>
                    </tr>
                </thead>
            </table>
        </div>
    );
};

export default ListTable;
